import React from 'react';
import ReactDOM from 'react-dom';

const Header = () => (
    <header>
        <h1>John Grohman</h1>
    </header>
)

const App = () => (
    <div className='app'>
        <Header />
    </div>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
